import React from "react";

function PortfolioCard(props) {
  console.log(props);
  return (
    <article className="portfolio-card" style={{ backgroundColor: props.bkgd }}>
      <div className="text-section">
        <h1 className="title">{props.title}</h1>
        <h4 className="subtitle">{props.subtitle}</h4>
        <p className="blurb">{props.blurb}</p>
      </div>

      <div className="thumb">
        <img src={props.img} alt={props.subtitle} />
      </div>
    </article>
  );
}

export default PortfolioCard;
